class Tardis {

    public function reducePolymer(string $input): string
    {
        $counter = 0;

        while (isset($input[$counter + 1])) {
            if ($this->checkForReaction($input, $counter)) {
                $input = substr_replace($input, '', $counter, 2);
                --$counter;
            } else {
                ++$counter;
            }
        }

        return strlen($input);
    }

    private function checkForReaction(string $input, int $counter): bool
    {
        return strtolower($input[$counter]) === strtolower($input[$counter + 1]) && $input[$counter] !== $input[$counter + 1];
    }
}